import React from 'react'
import Card from './Card';
import './App.css'
import Sdata from './Sdata';

const App = () => {
    return(
        <>
            <div className='cards'>
                <h1 className='heading_style'>List Of Top 5 Netflix Series In 2022</h1>
                {
                    Sdata.map((val)=>{
                        return(
                            <Card 
                                title = {val.title}
                                sname = {val.sname}
                                imgsrc = {val.imgsrc}
                                links = {val.links}
                            />
                        );
                    })
                }
            </div>
        </>
    );
}

export default App;
